class Solution:
    def maxOperations(self, s: str) -> int:
        c1 = 0
        f = 0
        r = 0
        for i in s+'1':
            if i == '1':
                if f:
                    r += c1
                    f = 0
                c1 += 1
            else:
                f = 1
        return r
